export var AccordionEnum = {};
AccordionEnum.variationWithoutImage = 1;
AccordionEnum.variationWithImage = 2;
AccordionEnum.expander = 3;
AccordionEnum[AccordionEnum.variationWithoutImage] = "variationWithoutImage";
AccordionEnum[AccordionEnum.variationWithImage] = "variationWithImage";
AccordionEnum[AccordionEnum.expander] = "expander";
